import React from 'react';
import styled from 'styled-components';

const footer = styled.footer`
    background: transparent;
    height: 60px;
    display: flex;
    justify-content: space-between;
    align-items: center;

    img {
        height: 40px;
        width: 40px;
        cursor: pointer;
    }
`;

function Footer() {
    return (
        <>
        <footer>
            <img href="/Home" src={require("../logos/linkedin.png")} />
            <img href="/Home" src={require("../logos/github.png")} /> 
        </footer>
        </>
    );  
}

export default Footer;
